#include <iostream>
#include <map>
#include <vector>
#include <algorithm>

using namespace std;
class Solution
{
    std::vector<int> lengts;

public:
    int lengthOfLongestSubstring(string s)
    {   
        
        if(s.length() == 0 || s.length() == 1) return s.length();

        for (int i = 0; i < s.length(); i++)
        {
            this->genStringWithIndex(i, s);
        }

        int val = *max_element(this->lengts.begin(), this->lengts.end());
        return val;
    }

    void genStringWithIndex(int index, string st)
    {
        string sA = "";
        string sB = "";
        bool chainBroken = false;
        if (index > 0)
        {
            int a = index;
            string s = "";
            while (a != -1)
            {
                // cout << this->isExist(s,st[a]);
                if (this->isExist(s, st[a]))
                {
                    chainBroken = true;
                    s = "";
                }
                else
                {
                    s = st[a] + s;
                    // cout<<s<<endl;
                }
                a--;
            }

            sA = s;
        }

        this->lengts.push_back(sA.length());

        if (index < st.length())
        {   
            int i = index + 1;
            string sa = "";
            while (i < st.length())
            {
                if (this->isExist(sa, st[i]))
                {
                    chainBroken = true;
                    sa = "";
                }
                else
                {
                    sa += st[i];
                    
                    this->lengts.push_back(sa.length());
                }
                i++;
            }

            sB = sa;
        }

        

        this->lengts.push_back(sB.length());
        if (chainBroken != true)
        {
            bool isValid = false;
            for (auto p : sB)
            {
                if (this->isExist(sA, p))
                {
                    isValid = false;
                    break;
                }
                else
                {
                    isValid = true;
                }
            }

            if (isValid)
            {
                string x = sA + sB;
                
               
                this->lengts.push_back(x.length());
            }
        }
    }

    bool isExist(string s, char ch)
    {
        for (auto a : s)
        {
            if (a == ch)
            {
                return true;
            }
        }

        return false;
    }
};

